import React from 'react'

import { UserContext } from '../../App'
function ComponentF() {
	return (

            <UserContext.Consumer>
               {
                user =>{
                    return
                    <div>
                        User context value {user}
                    </div>
                }
               }
            </UserContext.Consumer>


	)
}

export default ComponentF
